import React, { Component, Fragment } from "react";
import { GoogleMap, Marker } from "react-google-maps";

class Map extends Component {
  constructor(props) {
    super(props);
    console.log(this.props);
    this.state = {};
  }

  render() {
    return (
      <Fragment>
        <GoogleMap
          defaultZoom={12}
          defaultCenter={{ lat: this.props.lat, lng: this.props.lng }}
        >
          <Marker />
        </GoogleMap>{" "}
      </Fragment>
    );
  }
}

export default Map;
